(876, 0, 0, 0, 0, 'thanhtoan', 0, 0, '', '', '', '', 'Chuyn khon qua ngn hng', '', 'chuyen-khoan-qua-ngan-hang', '', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, '', '<p style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; font-family: Roboto, sans-serif;\">Thng tin ti khonngn hng:</p>\r\n\r\n<p style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; font-family: Roboto, sans-serif;\">Tn cng ty:<strong style=\"margin: 0px; padding: 0px; box-sizing: border-box;\">Corset chun</strong></p>\r\n\r\n<ul style=\"margin: 0px; padding-right: 0px; padding-left: 17px; box-sizing: border-box; list-style-type: circle; font-family: Roboto, sans-serif;\">\r\n	<li style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; list-style-type: circle;\">Ngn hng TM CP Si Gn Thng Tn (Sacombank)- PGD Lng Cha C - Tp.HCM<br style=\"margin: 0px; padding: 0px; box-sizing: border-box;\" />\r\n	S ti khon:<strong style=\"margin: 0px; padding: 0px; box-sizing: border-box;\">xxxxxxxxxxxx</strong></li>\r\n	<li style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; list-style-type: circle;\">Ngn hng TM CP Cng Thng Vit Nam (Vietinbank) - Chi nhnh 3 - Tp.HCM<br style=\"margin: 0px; padding: 0px; box-sizing: border-box;\" />\r\n	S ti khon:<strong style=\"font-family: Roboto, sans-serif; margin: 0px; padding: 0px; box-sizing: border-box;\">xxxxxxxxxxxx</strong></li>\r\n	<li style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; list-style-type: circle;\">Ngn hng NN v PTNN Vit Nam (Agribank) - Chi nhnh An Ph - Tp.HCM<br style=\"margin: 0px; padding: 0px; box-sizing: border-box;\" />\r\n	S ti khon:<strong style=\"font-family: Roboto, sans-serif; margin: 0px; padding: 0px; box-sizing: border-box;\">xxxxxxxxxxxx</strong></li>\r\n	<li style=\"margin: 0px 0px 10px; padding: 0px; box-sizing: border-box; list-style-type: circle;\">Ngn hng TMCP Ngoi thng Vit Nam - CN Tp.HCM<br style=\"margin: 0px; padding: 0px; box-sizing: border-box;\" />\r\n	S ti 