(879, 0, 0, 0, 0, 'tuyendung', 1, 0, 'latex-luoi-chuan-chau-au13232-9743.jpg', '', '', '', 'Chnh mn trnh din thm ha y  khin Karius', '', 'chinh-man-trinh-dien-tham-hoa-ay-da-khien-karius', '', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 'Chnh mn trnh din thm ha y  khin Karius b HLV Jurgen Klopp v Liverpool y sang Besiktas (Th Nh K) theo dng cho mn 2 nm. Ti y, th thnh sinh nm 1993 tip tc mc nhng li lm ng ngn.', '<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 15px; line-height: 1.6; color: rgb(0, 0, 0);\">Chnh mn trnh din thm ha y  khin<em style=\"line-height: 1.6;\">Karius</em>b HLV Jurgen Klopp v Liverpool ysang Besiktas (Th Nh K) theo dng cho mn 2 nm. Ti y, th thnh sinh nm 1993tip tc mc nhng li lm ng ngn.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 15px; line-height: 1.6; color: rgb(0, 0, 0);\">Mi y nht, trong trn u m mn bng K Europa League ma gii 2019/20 rng sng 20/9 (gi Vit Nam),<u>Karius</u> mc sai lm nghim trng khin Besiktas thng li bn u tin v thua chung cuc i ch nh Slovan Bratislava 2-4trn snTeheln pole (Slovakia).</p>\r\n', '', '', '', '', '', '', '', '', '', 1, 1, 1569032311, 0, 7, '', '', '', '', ''),
(872, 0, 0, 0, 0, 'camnhan', 0, 0, 'news-6693.png', '', '', '', 'Nguyn m nhn ', '', 'nguyen-my-nhan', '', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, '\"Khi mua hng s c chnh ch Vn ch shop kim tra barcode ... Mnh bit l cn rt nhiu a ch nc hoa uy tn khc  Si Gn & c H Ni. Ch Ch rt d thng nhit tnh, t vn tn tnh, c tm d s. Hng ha c gi cn thn, mnh rt hi lng vi phong cch lm vic chuyn nghip v nhanh chng ca Vn House Shop. Chc shop mua may bn t, gi c uy tn vi khch hng nh...\"', '', 'Gim c cng ty A', '', '', '', '', '', '', '', '', 1, 1, 1568953765, 1571730653, 2, '', '', '', '', ''),
(873, 0, 0, 0, 0, 'camnhan', 0, 0, 'news-2884.png', '', '', '', 'L th m tuyn ', '', 'le-thi-my-tuyen', '', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, '\"Khi mua hng s c chnh ch Vn ch shop kim tra barcode ... Mnh bit l cn rt nhiu a ch nc hoa uy tn khc  Si Gn & c H Ni. Ch Ch rt d thng nhit tnh, t vn tn tnh, c tm d s. Hng ha c gi cn thn, mnh rt hi lng vi phong cch lm vic chuyn nghip v nhanh chng ca Vn House Shop. Chc shop mua may bn t, gi c uy tn vi khch hng nh...\"', '', 'Gim c cng ty A', '', '', '', '', '', '', '', '', 2, 1, 1568953785, 1571730657, 0, '', '', '', '', ''),
(874, 0, 0, 0, 0, 'camnhan', 0, 0, 'gt-2902.png', '', '', '', 'Chu Tiu Cu ', '', 'chu-tieu-cuu', '', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, '\"Khi mua hng s c chnh ch Vn ch shop kim tra barcode ... Mnh bit l cn rt nhiu a ch nc hoa uy tn khc  Si Gn & c H Ni. Ch Ch rt d thng nhit tnh, t vn tn tnh, c tm d s. Hng ha c gi cn thn, mnh rt hi lng vi phong cch lm vic chuyn nghip v nhanh chng ca Vn House Shop. Chc shop mua may bn t, gi c uy tn vi khch hng nh...\"', '', 'Gim c cng ty A', '', '', '', '', '', '', '', '', 3, 1, 1568953816, 1571730661, 0, '', '', '', '', ''),
(898, 0, 0, 0, 0, 'tintuc', 1, 0, '7-4953.jpg', '', '', '', 'Trong s 13 i bng  na trn bng xp hng Ngoi hng Anh', '', 'trong-so-13-doi-bong-o-nua-tren-bang-xep-hang-ngoai-hang-anh', '', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 'Trong s 13 i bng  na trn bng xp hng Ngoi hng Anh tnh t v tr ca MU tr ln, th hng cng \"Qu \" t th 2. Sau 9 vng u, hng cng \"Qu \" mi c 10 ln \"nh n\", ch kh hn ng 1 i l Crystal Palace (8 bn thng). Nn nh, trn m mn MU thng Chelsea ti 4-0. Tc l 8 vng u sau , i bng ny ch ghi c 6 bn.', '<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 15px; line-height: 1.6; color: rgb(0, 0, 0);\">Trong s 13 i bng  na trn bng xp hng Ngoi hng Anh tnh t v tr ca MU tr ln, th hng cng \"Qu \" t th 2. Sau 9 vng u, hng cng \"Qu \" mi c 10 ln \"nh n\", ch kh hn ng 1 i l Crystal Palace (8 bn thng). Nn nh, trn m mn MU thng Chelsea ti 4-0. Tc l 8 vng u sau , i bng ny ch ghi c 6 bn.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 15px; line-height: 1.6; color: rgb(0, 0, 0);\">So snh mt cht  thy c s t hi ni hng cng MU. i bng c hng cng tt nht sau vng 9 Ngoi hng Anh l ng kim v ch Man City. on qun o xanh ca HLV Pep Guardiola ghi 29 bn sau 9 trn, trung bnh hn 3 bn/trn. Tc l s bn thng ca Man City sau vng 9 gp gn 3 ln MU.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; font-size: 15px; line-height: 1.6; color: rgb(0, 0, 0);\">V th, MU ang gp rt tm kim nhn s tng cng cho hng cng. Theo t Daily Mail, hin Ph ch tch Ed Woodward ang lin h vi Mario Mandzukic, hng a tin o ngi Croatia v<a class=\"TextlinkBaiviet\" href=\"https://www.24h.com.vn/manchester-united-c48e1521.html\" style=\"text-decoration-line: none; color: rgb(0, 0, 255); line-height: 1.6;\" title=\"Old Trafford\">Old Trafford</a>trong thng 1. V thng v ny c th kt thc ch vi 9 triu bng, r hn so vi con s 15 triu bng m Juventus tng yu cu.</p>\r\n', '', '', '', '', '', '', '', '', '', 1, 1, 1571726336, 0, 5, '', '', '', '', ''),
