(4, 0, 'tintuc', '251861-3183.png', '251861-3183_295x195.png', 'Kch bn i mt M - Trung gn o nhn to  Bin ng', 'kich-ban-doi-mat-my-trung-gan-dao-nhan-tao-o-bien-dong', 'Kch bn i mt M - Trung gn o nhn to  Bin ng', 'Kch bn i mt M - Trung gn o nhn to  Bin ng', 'Kch bn i mt M - Trung gn o nhn to  Bin ng', 'Khi tu ca M vo phm vi 12 hi l quanh cc o nhn to  Trng Sa, Trung Quc c th s cnh bo bng li v sau  iu tu chin v my bay khng ngi li ngn cn,  l mt trong cc kch bn d on.', '<p class=\"Normal\">M &atilde; th&ocirc;ng b&aacute;o cho c&aacute;c ng minh nh Philippines v&agrave; Australia v k hoch iu t&agrave;u tun tra n gn c&aacute;c b&atilde;i &aacute; ngm  Trng Sa, ni Trung Quc ci to phi ph&aacute;p th&agrave;nh o nh&acirc;n to. Bc Kinh phn ng rt tc gin, cho rng M v&agrave; ng minh &quot; du v&agrave;o la&quot; tranh chp khu vc, v&agrave; &quot;kh&ocirc;ng bao gi cho ph&eacute;p bt c nc n&agrave;o vi phm&quot; v&ugrave;ng m&agrave; h t cho l&agrave; thuc ch quyn ca m&igrave;nh.</p>\r\n\r\n<p class=\"Normal\">Theo &aacute;nh gi&aacute; ca gii quan s&aacute;t, chuyn iu t&agrave;u hin nay kh&ocirc;ng phi l&agrave; c&oacute; hay kh&ocirc;ng na, m&agrave; l&agrave; khi n&agrave;o, nh th n&agrave;o v&agrave; mc  nghi&ecirc;m trng ca h qu n &acirc;u.</p>\r\n\r\n<p class=\"subtitle\">T do H&agrave;ng hi</p>\r\n\r\n<p class=\"Normal\">Hot ng a t&agrave;u n gn c&aacute;c b&atilde;i &aacute;, khi din ra, s c M thc hin theo <span>Chng tr&igrave;nh T do H&agrave;ng hi ca hi qu&acirc;n M. N&oacute; c h&igrave;nh th&agrave;nh t nm 1979, di thi Tng thng Jimmy Carter, nhm m bo quyn t do i li tr&ecirc;n bin, tr&ecirc;n kh&ocirc;ng theo c&aacute;c iu khon ca C&ocirc;ng c Li&ecirc;n Hp Quc v Lut Bin (UNCLOS). </span></p>\r\n\r\n<p class=\"Normal\">Mc ti&ecirc;u ca FONOPS l&agrave; th&aacute;ch thc nhng &quot;tuy&ecirc;n b qu&aacute; &aacute;ng&quot; m&agrave; c&aacute;c quc gia a ra v hi phn v&agrave; kh&ocirc;ng phn kh&ocirc;ng tu&acirc;n theo quy nh ca UNCLOS, ch kh&ocirc;ng h&agrave;m &yacute; ngha c&ocirc;ng nhn hay b&aacute;c b ch quyn ca b&ecirc;n n&agrave;o.</p>\r\n\r\n<table align=\"center\" border=\"0\" cellpadding=\"3\" cellspacing=\"0\" class=\"tplCaption\" style=\"width: 100%;\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"kich-ban-doi-mat-my-trung-gan-dao-nhan-tao-o-bien-dong-1\" data-natural-width=\"500\" data-pwidth=\"470.4\" data-width=\"500\" src=\"http://m.f29.img.vnecdn.net/2015/10/14/2-3719-1444814421.jpg\" style=\"width: 100%;\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p class=\"Image\">Mt o nh&acirc;n to Trung Quc x&acirc;y dng phi ph&aacute;p tr&ecirc;n Bin &ocirc;ng. nh: <em>Telegraph</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p class=\"Normal\">Trong giai on 2013-2014, hi qu&acirc;n M &atilde; thc hin tng cng 54 FONOPS, trong &oacute; ch yu l&agrave; thuc khu vc ph tr&aacute;ch ca B T lnh Th&aacute;i B&igrave;nh Dng. Ch huy c quan n&agrave;y cho bit h &atilde; sn s&agrave;ng thc hin k hoch tun tra  Bin &ocirc;ng sau khi c&oacute; lnh.</p>\r\n\r\n<p class=\"subtitle\">Khi n&agrave;o v&agrave;  &acirc;u</p>\r\n\r\n<p class=\"Normal\">Trang News10 ca Australia dn li c&aacute;c chuy&ecirc;n gia ph&acirc;n t&iacute;ch cho bit quyt nh &atilde; c a ra, v&agrave; vic thc hin s din ra cui tun n&agrave;y hoc v&agrave;o tun ti. D o&aacute;n n&agrave;y c a ra sau cuc gp ca c&aacute;c b trng ngoi giao v&agrave; quc ph&ograve;ng M - Australia  Boston.</p>\r\n\r\n<p class=\"Normal\">Trc &oacute;, t Financial Times dn ngun qu&acirc;n s M cho bit vic thc hin tun tra s&aacute;t o nh&acirc;n to c&oacute; th din ra &quot;trong nhng ng&agrave;y ti&quot;. Theo SCMP,  xut k hoch n&agrave;y &atilde; c tr&igrave;nh l&ecirc;n ch&iacute;nh ph M t m&ugrave;a h&egrave;, nhng quyt nh c tr&igrave; ho&atilde;n cho n sau chuyn thm ca Ch tch Trung Quc Tp Cn B&igrave;nh th&aacute;ng 9 va ri.</p>\r\n\r\n<p class=\"Normal\">Chuy&ecirc;n gia Greg Poling, thuc Chng tr&igrave;nh minh bch H&agrave;ng hi ch&acirc;u &Aacute; ca Vin Chin lc v&agrave; Quc t M (CSIS)  do&aacute;n vic tun tra s &quot;ch din ra  c&aacute;c thc th ch&igrave;m khi thy triu l&ecirc;n trc khi vic bi p din ra, v&agrave;  c&aacute;ch xa c&aacute;c &aacute; kh&aacute;c  tr&aacute;nh nguy c&quot; v ph&aacute;p l&yacute; v&ugrave;ng nc. Nh vy &ocirc;ng cho rng c&aacute;c t&agrave;u ca M s tin n gn b&atilde;i Subi v&agrave; V&agrave;nh Khn. (C&aacute;c &aacute; n&agrave;y u nm trong qun o Trng Sa thuc ch quyn Vit Nam).</p>\r\n\r\n<p class=\"Normal\">C&aacute;c t&agrave;u M cng c&oacute; th s i gn c&aacute;c thc th kh&aacute;c trong qun o Trng Sa, theo <span>tin s Mira Rapp-Hooper, th&agrave;nh vi&ecirc;n Chng tr&igrave;nh An ninh ch&acirc;u &Aacute;-Th&aacute;i B&igrave;nh Dng thuc <span>Trung t&acirc;m An ninh M Mi (CNAS). Mc &iacute;ch ca vic n&agrave;y l&agrave;  t ra M kh&ocirc;ng &quot;thi&ecirc;n v&quot; bt c b&ecirc;n n&agrave;o ang c&oacute; tuy&ecirc;n b chng ln v ch quyn  &acirc;y. </span></span></p>\r\n\r\n<p class=\"subtitle\"><span><span>Nh th n&agrave;o</span></span></p>\r\n\r\n<p class=\"Normal\"><span><span>C&aacute;c chuy&ecirc;n gia qu&acirc;n s ca Trung Quc c d o&aacute;n s ra cnh b&aacute;o i vi c&aacute;c t&agrave;u M, v&agrave; kh&ocirc;ng  xy ra ng  nu ph&iacute;a M &quot;kh&ocirc;ng i qu&aacute; gii hn&quot;, b&aacute;o Hong Kong dn li gii ph&acirc;n t&iacute;ch d o&aacute;n. </span></span></p>\r\n\r\n<p class=\"Normal\"><span><span>&quot;Hi qu&acirc;n Trung Quc s y&ecirc;u cu c&aacute;c t&agrave;u M ri i bng c&aacute;ch ra cnh b&aacute;o ming&quot;, chuy&ecirc;n gia hi qu&acirc;n </span></span>Ni Lexiong n&oacute;i.</p>\r\n\r\n<p class=\"Normal\">Li Jie, chuy&ecirc;n gia Hi qu&acirc;n l&agrave;m vic  Bc Kinh, cho rng ph&iacute;a Trung Quc s iu t&agrave;u chin ngn chn t&agrave;u M, nu t&agrave;u M kh&ocirc;ng ri i sau c&aacute;c cnh b&aacute;o n&ecirc;u tr&ecirc;n.</p>\r\n\r\n<p class=\"Normal\">Mt ngun tin th&acirc;n cn vi qu&acirc;n i Gii ph&oacute;ng Nh&acirc;n d&acirc;n Trung Quc tit l rng Bc Kinh c&oacute; &quot;c&aacute;c gii ph&aacute;p hiu qu hn&quot; cho kch bn i mt  Trng Sa. &quot;Ch&uacute;ng t&ocirc;i c&oacute; th d&ugrave;ng m&aacute;y bay kh&ocirc;ng ngi l&aacute;i, hoc n gin l&agrave; d&ugrave;ng n Qu&acirc;n o&agrave;n ph&aacute;o binh s hai&quot;. Qu&acirc;n o&agrave;n ph&aacute;o 2 l&agrave; t&ecirc;n gi lc lng t&ecirc;n la chin lc ca Trung Quc.</p>\r\n\r\n<p class=\"Normal\"><span>B&agrave;y t th&aacute;i  cng rn trc k hoch ca M, ngi ph&aacute;t ng&ocirc;n B Ngoi giao Trung Quc Hoa Xu&acirc;n Doanh cng tuy&ecirc;n b &quot;</span><span>kh&ocirc;ng bao gi cho ph&eacute;p bt c nc n&agrave;o vi phm l&atilde;nh hi v&agrave; kh&ocirc;ng phn&quot; nc n&agrave;y t nhn  Trng Sa.</span></p>\r\n\r\n<p class=\"Normal\"><span>Tuy nhi&ecirc;n, trong mt b&agrave;i ph&acirc;n t&iacute;ch ng tr&ecirc;n website ca Trung t&acirc;m An ninh M Mi (CNAS), tin s Mira Rapp-Hooper, ch ra rng Trung Quc s kh&ocirc;ng c&oacute; l&yacute; n&agrave;o  phn ng mnh nn th&aacute;i qu&aacute; khi M thc hin c&aacute;c hot ng tun tra trong phm vi 12 hi l&yacute; quanh nhng o nh&acirc;n to phi ph&aacute;p m&agrave; Trung Quc x&acirc;y dng tr&aacute;i ph&eacute;p  Bin &ocirc;ng.</span></p>\r\n\r\n<p class=\"Normal\"><span>Hi u th&aacute;ng 9, nm t&agrave;u chin ca Trung Quc &atilde; i qua khu vc 12 hi l&yacute; ngo&agrave;i khi mt o thuc qun o Aleut tr&ecirc;n bin Bering ca M m&agrave; kh&ocirc;ng h xin ph&eacute;p nh&agrave; chc tr&aacute;ch M, vi l&yacute; do nhng con t&agrave;u n&agrave;y ang thc thi quyn &quot;i qua v&ocirc; hi&quot; theo quy nh ca UNCLOS. S l&agrave; &quot;o c gi v&agrave; c ngo mn&quot; nu Bc Kinh cho rng h c&oacute; quyn i qua l&atilde;nh hi ca M, trong khi t&agrave;u chin M kh&ocirc;ng c ph&eacute;p i v&agrave;o v&ugrave;ng bin quc t gn nhng o h bi p phi ph&aacute;p.</span> Ngo&agrave;i ra, c&aacute;c o nh&acirc;n to m&agrave; Trung Quc ang x&acirc;y, theo UNCLOS, u kh&ocirc;ng c&oacute; quyn c&oacute; l&atilde;nh hi hay kh&ocirc;ng phn bao quanh.</p>\r\n\r\n<table align=\"center\" border=\"0\" cellpadding=\"3\" cellspacing=\"0\" class=\"tplCaption\" style=\"width: 100%;\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"kich-ban-doi-mat-my-trung-gan-dao-nhan-tao-o-bien-dong-2\" data-natural-width=\"500\" data-pwidth=\"470.4\" data-width=\"500\" src=\"http://m.f29.img.vnecdn.net/2015/10/14/3-7160-1444814422.jpg\" style=\"width: 100%;\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p class=\"Image\">T&agrave;u chin Trung Quc din tp ph&oacute;ng t&ecirc;n la tr&ecirc;n bin. nh: <em>ChinaMil</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p class=\"subtitle\">H qu</p>\r\n\r\n<p class=\"Normal\">iu th&uacute;c y ph&iacute;a M i n k hoch n&agrave;y, theo Orville Schell, gi&aacute;m c Trung t&acirc;m nghi&ecirc;n cu quan h M - Trung, l&agrave; bi ch&iacute;nh quyn Obama &atilde; ht ki&ecirc;n nhn trc th&aacute;i  &quot;rt &eacute;p buc, thm ch&iacute; &ocirc;i khi g&acirc;y hn&quot; ca Trung Quc.</p>\r\n\r\n<p class=\"Normal\">&quot;T&ocirc;i ngh rng Washington c&oacute; l ang dn tin n im b&ugrave;ng n vi Bc Kinh&quot;, Schell nhn x&eacute;t. &quot;T&ocirc;i cho l&agrave; M &atilde; quyt nh chi rn hn&quot;.</p>\r\n\r\n<p class=\"Normal\">&quot;H qu ca vic n&agrave;y l&agrave; g&igrave;? T&ocirc;i kh&ocirc;ng bit. T&ocirc;i cho rng c&aacute;c b&ecirc;n u hiu cn c&oacute; c&aacute;ch n&agrave;o &oacute; sng chung vi Trung Quc. Nhng c&oacute; th Washington ang t hi liu c qu&aacute; tr&igrave;nh i thoi d&agrave;i dng dc &oacute; c&oacute; thc s mang li iu g&igrave; hay kh&ocirc;ng&quot;, Schell tip.</p>\r\n\r\n<p class=\"Normal\">&quot;iu t&agrave;u n ngay sau cuc gp thng nh Obama - Tp&quot;, &ocirc;ng Bill Bishop, chuy&ecirc;n gia v Trung Quc, n&oacute;i, &quot;l&agrave; mt du hiu cho thy mi quan h xu i n mc n&agrave;o. Rt kh&oacute; o&aacute;n kt qu ca k hoch n&agrave;y, nhng nu kh&ocirc;ng l&agrave;m, M s b cho l&agrave; yu i v&agrave; Trung Quc s ng&agrave;y c&agrave;ng qu quyt hn  ch&acirc;u &Aacute;&quot;.</p>\r\n', '', '', '', 1, 1, 1444875203, 0, 0);
