(53, '', 'cauchuyen', 'Cu chuyn v Diu Tm', '', '', 'cau-chuyen-ve-dieu-tam', '<div style=\"text-align: center; line-height: 25px; text-align: center;\">\r\n<h4 style=\"font-family: BeforetheRain; font-size: 20px; color: #101010; margin-bottom: 20px;\">Mn n gin d</h4>\r\n\r\n<p style=\"font-size: 15px; color: #151515; \">Ngi ta tm n mn chay mt phn l  thay i khu v , phn l  thanh tnh tm hn v phn  sng theo quan im tm linh. D l l do g i na, a Sen Vng cng sn sng gip bn khm ph hng v v gi tr ca mi mn n. Nh hng thit k thc n kt hp vi nhng hnh nh thc t ca mi mn gip bn...</p>\r\n</div>\r\n', '', '', '', '', '', '', '', 'cauchuyen-1282.png', '', 0, 0, 1571707532, 1571709413, '', '', '', '', ''),
